import React from "react";
import Menu from "./Menu";
import RecipeForm from "./RecipeForm";

export default function Header() {
    return(
        <header>
            <div>
                <span className='logo'>Meal Planner App</span>
                <ul className='navigation'>
                    <li>About us</li>
                    <li>Contacts</li>
                    <li>Profile</li>
                </ul>
            </div>
            <div className='present'></div>
        </header>

    )
}
